__author__ = 'weimw'

class Solution(object):
    # :type s: str
    # :rtype: str
    def shortestPalindrome(self, s):
        cut = 0
        for i in range(len(s))[::-1]:
            if self.isPalindrome(s[:i + 1]):
                cut = i
                break
        prefix = s[cut + 1:][::-1]
        return "".join(prefix) + "".join(s)

    def isPalindrome(self, s):
        i, j = 0, len(s) - 1
        while i <= j:
            if s[i] != s[j]:
                return False
            i += 1
            j -= 1
        return True

if __name__ == '__main__':
    sol = Solution()
